		// If length is greater than 100 characters; maximum file name length is 255 when .txt and .kml extensions are included
		if(fileName.length() > 100)
		{
			//	 fileName=(fileName.substring(0,100)+".txt");
			fileName=(fileName.substring(0,100)+job.getSeed());
		}
		else
			fileName=(fileName+job.getSeed());
